export default class NameForm extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			first_name: '',
			last_name: '',
			email_address: '',
			phone_number: '',
			company_name: '',
			effective_date: '',
			status: 'Pending'
		};

		this.handleChange = this.handleChange.bind(this);
		this.handleSubmit = this.handleSubmit.bind(this);
	}

	handleChange(event) {
		this.setState({ [event.target.name]: event.target.value });
	}

	handleSubmit(event) {
		alert('A name was submitted: ' + this.state.first_name);
		event.preventDefault();
		const policy = {
			first_name: this.state.first_name,
			last_name: this.state.last_name,
			email_address: this.state.email_address,
			phone_number: this.state.phone_number,
			company_name: this.state.company_name,
			effective_date: this.state.effective_date,
			status: 'Submitted'
		};
		console.log('current policy', policy);
	}

	render() {
		return (
			<div>
				{/* <form onSubmit={this.handleSubmit}> */}
				<input type="text" placeholder="First name" name="first_name" onChange={this.handleChange} />
				<input type="text" placeholder="Last name" name="last_name" onChange={this.handleChange} />
				<input type="text" placeholder="Email address" name="email_address" onChange={this.handleChange} />
				<input type="text" placeholder="Phone number" name="phone_number" onChange={this.handleChange} />
				<input type="text" placeholder="Company name" name="company_name" onChange={this.handleChange} />
				<input type="text" placeholder="Effective date" name="effective_date" onChange={this.handleChange} />
				<button onClick={this.handleSubmit}>Submit</button>
			</div>
		);
	}
}
